import React from 'react'
import { FaEdit, FaTrash } from 'react-icons/fa'
const List = ({list}) => {
  return  <section> 
      {
        list.map((item,index)=>{
          <p key={index}>{item}</p>
        })
      }
    </section>
}

export default List
